import React, { useState } from 'react';
import { createHome } from '../utils/api';
import { useNavigate } from 'react-router-dom';

function AddHomeForm({ onHomeAdded }) {
    const navigate = useNavigate();
    const [newHome, setNewHome] = useState({
        price: '',
        image_url: '',
        address: '',
        about: '',
        registered: '',
        // Add realtor-related fields
        realtor_first_name: '',
        realtor_last_name: '',
        realtor_email: '',
        realtor_phone: '',
        realtor_company: '', // Add any other realtor fields
        realtor_image_url: '', // Add any other realtor fields
    });

    const handleChange = (e) => {
        const { name, value } = e.target;
        setNewHome((prevHome) => ({
            ...prevHome,
            [name]: value,
        }));
    };

    const handleSubmit = async (e) => {
        e.preventDefault();

        try {
            // Make an API request to create a new home
            const createdHome = await createHome(newHome);
            // Call the callback function to notify the parent component of the new home
            onHomeAdded(createdHome);
            // Clear the form
            setNewHome({
                price: '',
                image_url: '',
                address: '',
                about: '',
                registered: '',
                // Clear realtor-related fields
                realtor_first_name: '',
                realtor_last_name: '',
                realtor_email: '',
                realtor_phone: '',
                realtor_company: '', // Clear any other realtor fields
                realtor_image_url: '', // Clear any other realtor fields
            });
            navigate('/');
        } catch (error) {
            console.error('Error creating home:', error);
        }
    };

    return (
        <form onSubmit={handleSubmit}>
            <div>
                <label htmlFor="price">Price:</label>
                <input
                    type="text"
                    id="price"
                    name="price"
                    value={newHome.price}
                    onChange={handleChange}
                    required
                />
            </div>
            <div>
                <label htmlFor="image_url">Image URL:</label>
                <input
                    type="text"
                    id="image_url"
                    name="image_url"
                    value={newHome.image_url}
                    onChange={handleChange}
                    required
                />
            </div>
            <div>
                <label htmlFor="address">Address:</label>
                <input
                    type="text"
                    id="address"
                    name="address"
                    value={newHome.address}
                    onChange={handleChange}
                    required
                />
            </div>
            <div>
                <label htmlFor="about">About:</label>
                <textarea
                    id="about"
                    name="about"
                    value={newHome.about}
                    onChange={handleChange}
                    required
                />
            </div>
            <div>
                <label htmlFor="registered">Registered:</label>
                <input
                    type="text"
                    id="registered"
                    name="registered"
                    value={newHome.registered}
                    onChange={handleChange}
                    required
                />
            </div>
            {/* Realtor-related fields */}
            <div>
                <label htmlFor="realtor_image_url">Realtor Image URL:</label>
                <input
                    type="text"
                    id="realtor_image_url"
                    name="realtor_image_url"
                    value={newHome.realtor_image_url}
                    onChange={handleChange}
                    required
                />
            </div>
            <div>
                <label htmlFor="realtor_first_name">Realtor First Name:</label>
                <input
                    type="text"
                    id="realtor_first_name"
                    name="realtor_first_name"
                    value={newHome.realtor_first_name}
                    onChange={handleChange}
                    required
                />
            </div>
            <div>
                <label htmlFor="realtor_last_name">Realtor Last Name:</label>
                <input
                    type="text"
                    id="realtor_last_name"
                    name="realtor_last_name"
                    value={newHome.realtor_last_name}
                    onChange={handleChange}
                    required
                />
            </div>
            <div>
                <label htmlFor="realtor_phone">Realtor Phone:</label>
                <input
                    type="text"
                    id="realtor_phone"
                    name="realtor_phone"
                    value={newHome.realtor_phone}
                    onChange={handleChange}
                    required
                />
            </div>
            <div>
                <label htmlFor="realtor_email">Realtor Email:</label>
                <input
                    type="text"
                    id="realtor_email"
                    name="realtor_email"
                    value={newHome.realtor_email}
                    onChange={handleChange}
                    required
                />
            </div>
            <button type="submit">Add Home</button>
        </form>
    );
}
